import React from "react";

const DetailAdress = (props) => {
  //   const name = props.adress.map((e) => e.name);
  //   console.log(name);
  return (
    <div className="container">
      {props.adress.map((adress) => {
        return (
          <div>
            <h3>{adress.name}</h3>
            <i className="fa fa-geo-alt-fill"></i>
          </div>
        );
      })}
    </div>
  );
};

export default DetailAdress;
